INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 0.0, 1, 10011, 0.0, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", 24008, "エリコ（バレンタイン）", 24, 8, 1, 0.0);
